import styled from "styled-components";


interface IContainerProps {
    color: string;
}

interface ITagProps {
    color: string;

}

export const Container = styled.li<IContainerProps>`
    background-color: ${props => props.theme.colors.tertiary};
    list-style: none;
    border-radius: 5px;
`;

export const Tag = styled.div<ITagProps>`

`;
